CREATE TABLE IF NOT EXISTS `items` (
  `item` varchar(50) NOT NULL,
  `label` varchar(50) NOT NULL,
  `limit` int(11) NOT NULL DEFAULT 20,
  `can_remove` tinyint(4) NOT NULL DEFAULT 1,
  `type` varchar(50) NOT NULL DEFAULT 'item_standard',
  `usable` tinyint(4) NOT NULL DEFAULT 0,
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `groupId` int(11) DEFAULT 1,
  `metadata` varchar(255) DEFAULT '{}',
  `weight` float DEFAULT 0.5,
  `desc` varchar(255) DEFAULT 'Item importat',
  `degradation` int(11) DEFAULT 0,
  PRIMARY KEY (`id`),
  UNIQUE KEY `item` (`item`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

TRUNCATE TABLE `items`;

